import React from 'react'
import Navbar from '../Components/Navbar'

const HomePage = ({theme,setTheme}) => {
  return (
    <div className={`container ${theme}`}>
      <Navbar theme={theme} setTheme={setTheme} />
    </div>
  )
}

export default HomePage
